O melhor aplicativo de táxi do Brasil.
Receba seu táxi com a maior qualidade de atendimento, segurança e benefícios do mercado.
Destaques:
- Preço Fixo: Agora você sabe o quanto vai pagar antes mesmo do táxi chegar;
- Pagamento via Apple Pay;
- Aplicativo simples e intuitivo: Seu táxi em 2 cliques;
- Desconto de até 40% em suas corridas (confira as cidades disponíveis em nosso site);
- Cartão de Crédito Porto Seguro: 20% de desconto nas suas corridas pagas pelo aplicativo, além de pontos em dobro no Programa de Relacionamento Porto Seguro*;
- Estimativa de valor de corrida;
- Taxistas favoritos;
- Abertura de corrida dentro do táxi.

Vantagens:
• Segurança: informações do taxista e veículo e acompanhamento do trajeto enquanto ele se aproxima do local;
• Tranquilidade: veja a distância e o tempo de chegada aproximado do seu táxi;
• Facilidade: adicione endereços favoritos e recentes para chamar seu táxi no dia a dia.

Empresas:
Solução corporativa para empresas que buscam facilidade, controle e redução de custos em suas despesas de táxis corporativos. Conte com os benefícios que nosso serviço oferece:
- Redução até 60% nos custos com táxis corporativos;
- Rapidez e praticidade ao pedir táxi e pagar pelo próprio aplicativo;
- Flexibilidade: Chamada pela plataforma web ou pelo aplicativo;
- Controle: Relatórios de corridas de seus funcionários e colaboradores;
- Personalização: Organização dos acessos por perfil organizacional;
- Segurança: Controle de prevenção a fraudes.

Através do aplicativo Clube Candeias você poderá pesquisar por milhares de destinos em todo o mundo, pagar suas reservas com mais segurança e acompanhar informações e novidades com apenas alguns cliques.

Baixe agora mesmo e comece a programar sua próxima viagem!

Aproveite as vantagens exclusivas do Clube Candeias:

- Hospede-se em unidades próprias a preços imbatíveis;
- Obtenha valores especiais na rede integrada por todo o mundo;
- Faça reservas em uma plataforma online, segura e exclusiva;
- Seja atendido por uma rede de relacionamento exclusiva e qualificada;
- Acumule pontos e viaje ainda mais com o nosso Programa de Recompensas*;
- Encontre acomodações para até 12 pessoas e leve convidados com você.

* Saiba mais sobre o Programa de Recompensas em: https://www.clubecandeias.com/recompensas

